import React from 'react';
import { Link, animateScroll } from 'react-scroll';
import styles from './Navbar.module.css';

const navbar = (props) => {
    const theme = props.theme;
    return (
        <nav className={styles.nav} id='navbar'>
            <div className={styles.navContent}>
                <h3 onClick={props.click} >RT</h3>
                <ul className={styles.navItems}>
                    <li className={styles.navItem}>Section 2</li>
                    <li className={styles.navItem}>Section 1</li>
                    <li className={styles.navItem}>Section 3</li>
                    <li className={styles.navItem}>Section 4</li>
                    <li className={styles.navItem}>Section 5</li>
                </ul>
            </div>
        </nav>
    )
};

export default navbar;
